  input: TEXT,F3XA,,"We are now submitting electronically the original unamended Year
    End Report for 2000 and the amended Year End Report for 2000.  This report was
    originally filed in paper form with the FEC on1/31/01.  In August 2001, we discovered
    omissions in some of our 2000 filings and amended the necessary 2000.  As a result
    of personnel turnover, it was discovered that some information had been omitted
    from our first report in 2000 that impacted all of the reports thereafter.  Additionally,
    disbursements and previously reported disbursements that were subsequently voided
    were omitted from some of the reports.  All of the amended reports were sent in
    electronic format on a floppy disk to the FEC on 8/8/01 via certified mail.  Subsequent
    to receipt of the amended reports by the FEC Electronic Filing Group, we were
    asked by the FEC to submit the Year End Report (11/28/00-12/31/00) in paper format
    because that is the manner in which the original report was filed.  We hope this
    matter is now resolved. Please contact us if you have any questions."
